package main
import (
  "bytes"
  "encoding/base64"
  "github.com/computeportal/glui"
)
const (
  breugel_data =""
)
var breugel = &glui.ImageData{nil, 0, 0}
func load_breugel() bool {
  b, err := base64.StdEncoding.DecodeString(breugel_data)
  if err != nil {panic(err)}
  buf := bytes.NewBuffer(b)
  data, err := glui.DecodeJPG(buf)
  if err != nil {panic(err)}
  breugel.Pix = data.Pix
  breugel.W = data.W
  breugel.H = data.H
  return true
}
var breugel_loaded = load_breugel()